import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Login from '../pages/Login'
// import EnqPage from './EnquetePage';
// import CreateEnquete from '../pages/CreateEnquete';

export default function Router() {
  return (
    <BrowserRouter >
      <Routes>
        <Route exact path="/" element={<Navigate to="/login" />}></Route>
        {/* {/* <Route exact path="/enquetes" element={<Enquetes />} /> */}
        {/* <Route exact path="/enquetes/:id" element={<EnqPage />} /> */}
        <Route exact path="/createEnquete" element={<CreateEnquete />} /> 
      </Routes>
    </BrowserRouter >
  );
}
